import minus from "./img/minus.png";
import inspiration from "./img/1.png";
import plus from "./img/plus.png";
import line from "./img/line.png";
import Door from "./Door.js";
import "./App.css";

function App() {
  return (
    <>
      <div id="grid">
        <h1 id="title">Schneegest√∂ber</h1>

        <div class="top_row">
          <div class="inspiration_dice">
            <img src={minus} alt="minus" class="operation"></img>
            <img src={inspiration} alt="inspiration" class="inspiration"></img>
            <img src={plus} alt="inspiration" class="operation"></img>
          </div>
          <div class="character_link">
            <button class="character">character sheet</button>
            <img src={line} alt="line" class="line"></img>
          </div>
        </div>
        <Door />
      </div>
    </>
  );
}

export default App;
